    Button,
} from '@chakra-ui/react';

function ConnectWalletButton() {

    async function connectWallet() {
        if(window.ethereum) {
            console.log("metamask installed")
        }
    }

    return (
        <Button onClick={connectWallet}>Connect Wallet</Button>
    )
}

export default ConnectWalletButton;
